import user from '../backend/user.json';
import Profile from '../Profile';

const Container = () => {
  return (
    <div className="Container">
      <Profile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
      <Statistics />;
    </div>
  );
};

export default Container;
